import org.apache.commons.compress.archivers.dump.DumpArchiveEntry;
import java.util.ArrayList;

public class Main {
    public static void main(String[] args) {
        DumpArchiveEntry entry = new DumpArchiveEntry();
        /* write */ entry.setUserId(1001);

        // Create a list to store DumpArchiveEntry objects
        ArrayList<DumpArchiveEntry> entryList = new ArrayList<>();

        // Add the entry to the list
        entryList.add(entry);

        // Create another entry and set different properties
        DumpArchiveEntry anotherEntry = new DumpArchiveEntry();
        anotherEntry.setUserId(2002);
        entryList.add(anotherEntry);

        // Iterate over the list and print user IDs
        for (DumpArchiveEntry e : entryList) {
            System.out.println("User ID in list: " + e.getUserId());
        }

        // Perform some unrelated calculations
        int result = 0;
        for (int i = 1; i <= 5; i++) {
            result += i * i;
        }
        System.out.println("Sum of squares from 1 to 5: " + result);

        // Use the read method from the original entry
        /* read */ int userId = entry.getUserId();
        System.out.println("Original Entry User ID: " + userId);

        // Further manipulation of the list
        for (DumpArchiveEntry e : entryList) {
            e.setUserId(e.getUserId() + 100);  // Increment user ID by 100
        }

        // Print updated user IDs
        for (DumpArchiveEntry e : entryList) {
            System.out.println("Updated User ID in list: " + e.getUserId());
        }
    }
}
